import Clock from '../Clock/Clock';
import pocketContext from '../../../context/pocketContext';

function App() {
  const {
    pageName,
  } = useContext(pocketContext);
  return (
    <header className="App-header row s-evenly">
      <h1 className="i-b animate__backInRight">
       Hello,<br />
       Humberto</h1>
      <H1 className='pagename'>{ pageName }</H1>
    </header>
  );
}

export default App;
